import React from "react";

function cell(props) {
    function cellHover(){
        document.getElementById("field").style.opacity="80%";
    }
    document.getElementById("field").addEventListener(onmouseover, cellHover);
  return <li id="field">{props.name}</li>;
}

export default cell;
